How to return Mongo's _id with session in NextAuth?<p>I'm new to NextAuth. I'm using the NextAuth credentials provider with Mongodb.
Based on NextAuth documentation, if I want to check the user session I could use useSession() in client components while getServerSession() for server components. By default, the session contains a user object which contains only name, email, and image properties. But what if I want to pass additional properties to my session like the _id that Mongodb generates when creating documents?</p>
<p>According to NextAuth, If I want to pass additional data to the session, I should add an acync callback session to my auth options. Since I'm using a JWT strategy which is the default strategy, I should add an async jwt callback before the session callback.</p>
<p>My auth options:</p>
<pre><code>export const authOptions = {
    providers: [
        CredentialsProvider({
            name: 'Sign in',
            credentials: {},
            async authorize(credentials, req) {
                const { email, password } = credentials

                try {
                    await connectDB()
                    const customer = await Customer.findOne({ email })
                    if (!customer) null

                    //check whether the passwords are correct
                    const pwdComparisonResult = await bcrypt.compare(password, customer.password)
                    if (pwdComparisonResult) {
                        return customer
                    }

                    return null

                } catch (error) {
                    console.log('error ', error);
                }
            }
        }),
    ],
    callbacks: {
        async jwt(token, user, session) {
            //What I should write and return inside jwt?
        },

        async session({ session, token, user }) {
            //What I should write and return inside session?
        }
    },
    session: {
        strategy: &quot;jwt&quot;
    },
    pages: {
        signIn: '/login',
    }
}
</code></pre>
<p>As far as I know, the jwt will return a token and the session callback will receive this token and return a session. Is that true? Could someone explain how data flows between the authorize, jwt, and session and what logic I should be writing in the jwt and session callbacks in order to be able to access the mongo id along with the name and email properties?</p>

