Unable to populate data on the dropdown on React<p>I have two schemas on the MongoDB. &quot;Assign schema&quot; which contains two fields user_story_id and user_id and another schema for User_story which contains the description of the user story. I want to create drop down within a form which will populate the assigned user stories. The assigned user story id can be obtained from the Assign schema and the User stories descriptions can be obtained from the User_story schema. So, I need both schemas for the implementation. Basically, we need to create a mapping between &quot;Assign&quot; and &quot;User_story&quot; schema. I implemented it in React. The implementation code block is</p>
<p>The code block is</p>
<pre><code>import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import axios from 'axios';

export default function Task({}) {

  const [taskValues, setTaskValues] = useState({
    task: '',
    userStory: 'userStory1', // Default value
    createdBy: 'user1',       // Default value
