  });

  const [allTask, setAllTask] = useState([{}]);
  const [assigned, setAllAssign] = useState([]);
  const[allStories, setAllStories] = useState([{}]);



  const assignedUserStories = assigned.map((assigns) =&gt; {
    return assigns.user_story_id;

  })


  const handleChange = (event) =&gt; {
    setTaskValues({ ...taskValues, [event.target.name]: event.target.value });
  };

  const loggedInUser = localStorage.getItem('loggedInUser')
  const handleCreateTask = (e) =&gt; {
      e.preventDefault();
      const taskDetails = {
        task: taskValues.task,     //captured from input task
        user_story_id: taskValues.userStory,      //captured from dropdown
        status: taskValues.status,      //captured from status dropdown
        created_by: loggedInUser
    }

    // Post taskValues data to your server endpoint
    axios.post('http://localhost:9000/createTask', taskValues)
    .then((res) =&gt; {
      if (res.data) {
        alert('Task creation Successful');
      }
    })
    .catch((err) =&gt; {
      alert('Error in creating the task');
    });
  };

    useEffect(() =&gt; {
      axios.get('http://localhost:9000/getTaskList').then(function (response) {
      const Taskdata = response.data;
      setAllTask(Taskdata);
    });

    axios.get('http://localhost:9000/getUserstory').then(function (response) {
      const Allstories = response.data;
      setAllStories(Allstories);
    });

    axios.get('http://localhost:9000/getAssignedstories').then(function (response) {
      const Allassignedstories = response.data;
      setAllAssign(Allassignedstories);
    });


  }, []);

  const handleSubmit = (event) =&gt; {
    event.preventDefault();

  };

  return (
    &lt;div className=&quot;container mt-5&quot;&gt;
      &lt;div className=&quot;row justify-content-center&quot;&gt;
        &lt;div className=&quot;col-md-6 col-lg-4&quot;&gt;
          &lt;div className=&quot;card&quot;&gt;
            &lt;div className=&quot;card-body&quot;&gt;
              &lt;h2 className=&quot;card-title&quot;&gt;Create a New Task&lt;/h2&gt;
              &lt;form onSubmit={handleSubmit}&gt;
                &lt;div className=&quot;form-group&quot;&gt;
                  &lt;label&gt;Task:&lt;/label&gt;
                  &lt;textarea
                    className=&quot;form-control&quot;
                    name=&quot;task&quot;
                    value={taskValues.task}
                    onChange={handleChange}
                  /&gt;
                &lt;/div&gt;

                &lt;div className=&quot;form-group&quot;&gt;
                  &lt;label&gt;User Story:&lt;/label&gt;
                  &lt;select
                    className=&quot;form-control&quot;
                    name=&quot;userStory&quot;
                    value={taskValues.userStory}
                    onChange={handleChange}
                  &gt;
                    {assignedUserStories.map((stories) =&gt;
                      &lt;option key={stories._id} value={stories._id}&gt;{stories.user_story}&lt;/option&gt;

                    )}

                  &lt;/select&gt;
                &lt;/div&gt;

                &lt;div className=&quot;form-group&quot;&gt;
                  &lt;label&gt;Created by:&lt;/label&gt;
                  &lt;select
                    className=&quot;form-control&quot;
                    name=&quot;createdBy&quot;
                    value={taskValues.createdBy}
                    onChange={handleChange}
                  &gt;
                    &lt;option value=&quot;user1&quot;&gt;User 1&lt;/option&gt;
                    &lt;option value=&quot;user2&quot;&gt;User 2&lt;/option&gt;
                    &lt;option value=&quot;user3&quot;&gt;User 3&lt;/option&gt;
                  &lt;/select&gt;
                &lt;/div&gt;

                &lt;div className=&quot;form-group&quot;&gt;
                  &lt;label&gt;Status:&lt;/label&gt;
                  &lt;select
                    className=&quot;form-control&quot;
                    name=&quot;status&quot;
                    value={taskValues.status}
                    onChange={handleChange}
                  &gt;
                    &lt;option value=&quot;New&quot;&gt;New&lt;/option&gt;
                    &lt;option value=&quot;In Progress&quot;&gt;In Progress&lt;/option&gt;
                    &lt;option value=&quot;Awaiting Confirmation&quot;&gt;Awaiting Confirmation&lt;/option&gt;
                    &lt;option value=&quot;Completed&quot;&gt;Completed&lt;/option&gt;

                  &lt;/select&gt;
                &lt;/div&gt;

                      &lt;button
                      onClick={() =&gt; handleCreateTask()}
                      className=&quot;btn btn-primary btn-block&quot;
