Access to the nested structure in MongoDB<p>I'm designing an API and a database structure for educational courses with the following hierarchy: Course -&gt; Module -&gt; Lesson -&gt; Topic -&gt; Tasks (Body).</p>
<pre class="lang-js prettyprint-override"><code>[
    {
        _id: ObjectId('a...')

        name: &quot;How to cook borscht&quot;,

        modules: [
            {
                id: ObjectId('b...'), // Perhaps not ObjectId, I haven't figured it out yet.
                title: &quot;Analyzing the composition&quot;,

                lessons: [
                    {
                        id: ObjectId('c...'),
                        title: &quot;Selecting the Cabbage&quot;

                        topics: [
                            id: ObjectId('d...'),
                            title: &quot;White Cabbage&quot;,

                            tasks: [
                                 id: ObjectId('e...'),
                                 description: &quot;White cabbage is a common vegetable crop, one of the cultivated variants of the species Brassica oleracea.&quot;
                            ]        
                        ]
                    }
                ]
            }
        ]
    }
]
</code></pre>
<p>It is assumed that the first request to /api/courses will return the course structure to the user as a program description. Then, to start learning, I need to return the first lesson <code>topics[0]</code> with all the assignments.</p>
<pre class="lang-js prettyprint-override"><code>modules[$id].lessons[$id].topics[$id].tasks
</code></pre>
<p>After completing a lesson, it's intended to record that it's been completed (this might require a separate table with a list of users and their activity). It's assumed that all course content will be stored in one document, and there may be different translations (there is a possibility that the document size will exceed 16MB).</p>
<p>Question: How to design the document structure to efficiently retrieve a list of tasks for a specific course?</p>

