<p>Now I want to search for values of certain <code>id</code>s (dynamically selected by the user), matching a regular expression (entered by the user and properly escaped to actually search for a substring only). As I need to extract the values for the mentioned <code>id</code>s I am using a aggregation pipeline starting with a <code>$match</code>:</p>
<pre><code>{ $match: {
    items: { $elemMatch: {
