How to create multi-filtering for mongoose<p>I have an online game store and code that filters data by tags and genres. But I also want to add filtering by platforms and systems. For example, the system is PC and the platform is Steam. How can I implement this?</p>
<p><strong>Schema</strong></p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const slug = require('mongoose-slug-updater');
const options = {
    separator: &quot;-&quot;,
    lang: &quot;en&quot;,
    truncate: 120
}
mongoose.plugin(slug, options);
const GamesSchema = new mongoose.Schema({
    title: String,
    slug: { type: String, slug: [&quot;title&quot;], slugPaddingSize: 2, unique: true },
    last_url: String,
    description: String,
    preview: {
        src: String,
        alt: String
    },
    stock_price: String,
    discount: Number,
    total_price: String,
    system: Array,
    platform: String,
    info: {
        Genre: Array
    },
    tags: Array,
    config: Object,
    images: Array,
    keys: Array,
    content: String
})
module.exports = mongoose.model(&quot;Games&quot;, GamesSchema);
</code></pre>
<p><strong>api controller</strong></p>
<pre><code>async get(req, res) {
        try {
            const page = parseInt(req.query.page) - 1 || 0;
            const limit = parseInt(req.query.limit) || 5;
            const search = req.query.search || '';
            let sort = req.query.sort || &quot;top&quot;;
            let tags = req.query.tags || 'all';
            const tagsOpt = [];
            Games.find().then(async games =&gt; {
                games.forEach(game =&gt; {
                    game.tags.forEach(tag =&gt; {
                        if (!tagsOpt.includes(tag)) {
                            tagsOpt.push(tag)
                        }
                    })
                })

                tags === 'all' ? (tags = [...tagsOpt]) : (tags = req.query.tags.split(','));
                req.query.sort ? (sort = req.query.sort.split(',')) : (sort = [sort]);

                let sortBy = {};
                if (sort[1]) {
                    sortBy[sort[0] = sort[1]];
                } else {
                    sortBy[sort[0] = &quot;top&quot;]
                }
                const gamesData = await Games.find({ title: { $regex: search, $options: 'i' } })
                    .where('tags')
                    .in([...tags])
                    .sort(sortBy)
                    .skip(page * limit)
                    .limit(limit);

                const total = await Games.countDocuments({
                    tags: { $in: [...tags] },
                    title: { $regex: search, $options: 'i' },
                });
                const response = {
                    error: false,
                    total,
                    page: page + 1,
                    limit,
                    tags: tagsOpt,
                    gamesData
                };
                res.status(200).json(response);
            })
        } catch (error) {
            console.log(error);
            res.status(400).json({ message: ' ' })
        }
    }
</code></pre>
<p>I was able to combine genres and tags into one and filter by them, do I really now need to put both the platform and the systems into an array of tags?</p>

